import React,{Component} from 'react';
import './History.css'
import axios from "axios"
class History extends Component{
    constructor (props) {
        super(props)
        this.state = {
          data:[],
          time:[],
          name:''
        }
     }
    componentDidMount() {
        axios.get('/history')
        .then(res=>{
        //   console.log(res.data);
          this.setState({
            data:res.data
            // order1:res.data
        });
        })
        axios.get('/history_time')
        .then(res=>{
        //   console.log(res.data);
          this.setState({
            // order:res.data
            time:res.data
        });
        })
        axios.get('/test')
        .then(res=>{
        //   console.log(res.data);
          this.setState({
            name:res.data
        });
        })
    }
    

  render(){
    //   var data=this.props.data;
      console.log(this.state.data,this.state.time);
    //   var d=data[0] || {soluong:1};
      return(
        <div className="cart">
            <p><b>LỊCH SỬ MUA HÀNG   </b></p>
            <div className="tb">
                <div>NGÀY VÀ GIỜ:  </div>
                <div className="tb1">
                    <div className="row tb1top">
                        <div className="col-7 clear"><p className="">TÊN SẢN PHẨM</p></div>
                        <div className="col-5 row">
                            <div className="col-4"><p>GIÁ TIỀN</p></div>
                            <div className="col-3"><p>SỐ LƯỢNG</p></div>
                            <div className="col-4"><p>CỘNG</p></div>
                            
                        </div>
                    </div>
                </div>
            </div>
        </div>
      )
  }
}
export default History;
